import React, { useEffect } from 'react';
import List from "./List";

const server_url = 'http://localhost:11037';

function Lists(props) {
    const [lists, setLists] = useState([]);

    useEffect(() => {
        // Define an async function to fetch the lists
        const fetchLists = async () => {
            try {
                const options = {
                    method: 'GET',
                    headers: {
                        'Content-Type': 'application/json',
                    }
                }
                const response = await fetch(server_url + '/lists', options);
                const data = await response.json();
                setLists(data); // Update the state with the fetched lists
            } catch (error) {
                console.error('Error fetching lists:', error);
            }
        };

        // Call the fetchLists function to fetch the lists
        fetchLists();
    }, []);

    return (
        <div>
            <h1>Lists</h1>

            <div className="item-container">
              {lists.map((list, index)=> (
                <div key={index} className="items">
                    <img src={list.title} alt='movie' className='movie-image'></img>
                    <div className="overlay"></div>
                </div>
              ))}
      </div>

            <List items={props.movies} />
        </div>
    )
}

export default Lists;
